ogreen Concentration ng/ul\npicodrop_concentration\tPicoDrop Concentration ng/ul\n\nNOTE: Enumerations in grey are deprecated. Although deprecated codes will continue to be accepted they will re removed from the next release and users are encouraged to use other suitable codes.\n\nBusiness rules:\nContains the business rules that often apply across data elements within the context of a csv file submission i.e. if the test type is x we expect value y\n\nIn this version of the document, the data item identifiers have been included, to facilitate look-up in the current version of the on-line metadata catalogue. In addition you can click on the value link to view the full definition for the data type and the applicable constraints\n\n\nCompleteness:\n\nFrom a data modelling perspective most of the classes are optional, with the exception of the registration and consent information, in that an event of that class may not yet have occurred, or may not yet have been reported, for a particular participant.   \nEvent records or reports are required for all relevant clinical events or observations to date (for the core data).\nFor some classes of event, a report will be accepted only if additional classes are provided as part of the report and/or other values are supplied for some of the data items involved: these are the mandatory items within those classes.\nAn item is mandatory for a particular class if it has a multiplicity of 1..1 or 1..* \nWhere an item has a multiplicity of 0..1 it is considered non-mandatory and a report for that class of event will be accepted even if no value has been supplied for that item.   \nFrom a contractual perspective, however, values are expected for all applicable data",
