      "internalModelCatalogueId": "http://localhost:8090/catalogue/dataModel/3359@2.0.0",
      "archived": true,
      "name": "Cancer Model",
      "description": "Introduction  \nGenomic Medicine Centres are asked to supply detailed patient information to accompany the samples submitted for analysis. The success of the 100,000 Genomes Project  and the quality and value of the clinical reports produced  rests upon the accuracy and completeness of the information supplied. \nThe information is divided into  \n\tessential sample metadata  information about the sample and participant, provided before the sample is sent for sequencing  \n\tcore data  information on relevant clinical events and observations made at the time of registration or drawn from existing patient records, provided within six weeks of sample collection  \n\tadditional data  information on all subsequent, relevant clinical events and observations. These should be provided within four weeks of the event in question Which events and observations are deemed relevant will depend upon the cancer identified during patient registration and subsequent diagnosis.  \nReporting  \nThe information required can be provided in two ways: using the web-based case report forms provided by Genomics England, or via a local, integrated records system that can produce reports in XML format for subsequent uploading. Genomic Medicine Centres are strongly encouraged to develop local integrated systems for cancer. As well as providing a valuable resource for patient management and local research activity, such systems will greatly facilitate the process of clinical review prior to submission.  \nCompleteness  \nFrom a data modelling perspective, all of the classes are optional, in that an event of that class may not yet have occurred, or may not yet have been reported, for a particular participant. Event records or reports are required for all relevant clinical events or observations to date (for the core data) and going forward (for the additional data). For some classes of event, a report will be accepted only if values are supplied for some of the data items involved: these are the mandatory items within those classes. An item is mandatory for a particular class if it has a multiplicity of 1..1 or 1..* Where an item has a multiplicity of 0..1 it is considered non-mandatory and a report for that class of event will be accepted even if no value has been supplied for that item. From a contractual perspective, however, values are expected for all applicable data items, for all relevant classes of event. \nThis document  \nThe remainder of this document describes the different classes of data expected, the association between diseases and the classes of data deemed relevant, and the datatypes employed. Each data item is associated with a name, a brief explanation, a multiplicity, and a datatype. In this version of the document, the data item identifiers have been included, to facilitate look-up in the current version of the on-line metadata catalogue. In addition you can click on the value link to view the full definition for the data type and the applicable constraints.",
