      "archived": true,
      "name": "Cancer Sample Tracking GeL GMC",
      "description": "Purpose\n\nThe purpose of this document is to describe the data that Genomic Medicine Centres are asked to supply to accompany the samples submitted for analysis.  The GMC laboratory will provide a set of sample metadata, and a set of test results, for each sample successfully processed.  The complete set should be supplied at or before the time at which the derived products for example, the extracted DNA are dispatched and accepted to the Genomics England Biorepository.\n\nAudience\n\nThis document is primarily written for informatics leads within the GMCs and those involved in the collection and submission of data for the UK 100,000 Genomes Project.\n\nRelated Documents\n\nThis document should be read in conjunction with:\n\tGenomics England Data Model Catalogue (https://gelmc.extge.co.uk/#/40548/dataClass/40558 )\n\tUser Guide for Cancer Data Specification v3.0.0  (contained in this release pack)\n\tExample CSV Files (contained in this release pack)\n\tNHS England GMC, Trust, Clinic, Laboratory Reference Data\n\tNHS England GMC Service Specification\n\n\nHow to use this document\n\nThis document is split into sections that describe the information we expect to receive within the context of each csv submission, so it is primarily split by file type. Within each csv we expect to receive a set of rows of data. Within each row we expect to receive a number of data elements, each of which is associated with a name, a brief explanation, a multiplicity, a datatype and often a rule. The Rules reference refers to the rule id at the back of the document,\n\nNOTE: this document should be used in conjunction with the User Guidance for Cancer Data Specification Document. In particular see the sample tracking related annexes for more information on \n\nCsv file definitions:\nContains a list of data elements included in each submission with their corresponding data type and the business rules.\nClick on the data types and business rules to navigate to the type.\nData types:\nContains the data types, rules and enumerations that constrain the value of a data element.\nRules are expressed as regular expressions and/or java code.\nEnumerations are described by their code and description:\npercent_necrosis\tProportion of the submitted tumour sample that is necrotic (0-100)\npicogreen_concentration\tPicogreen Concentration ng/ul\npicodrop_concentration\tPicoDrop Concentration ng/ul\n\nNOTE: Enumerations in grey are deprecated. Although deprecated codes will continue to be accepted they will re removed from the next release and users are encouraged to use other suitable codes.\n\nBusiness rules:\nContains the business rules that often apply across data elements within the context of a csv file submission i.e. if the test type is x we expect value y\n\n\nCompleteness:\n\nAn column is mandatory if it has a multiplicity of 1..1.\nWhere an item has a multiplicity of 0..1 it is considered non-mandatory however, please see the associated business rules as many of the optional columns are mandatory in certain contexts.",
