      "archived": true,
      "name": "Cancer Model",
      "description": "Purpose\n\nThe purpose of this document is to describe the data that Genomic Medicine Centres are asked to supply to accompany the samples submitted for analysis. This document is intended to be read in conjunction with the User Guide and describe the classes of data expected, the association between diseases and the classes of data deemed relevant, and the datatypes employed.  \n\nAudience\n\nThis document is primarily written for informatics leads within the GMCs and those involved in the collection and submission of data for the UK 100,000 Genomes Project.\n\nRelated Documents\n\nThis document should be read in conjunction with:\n\tGenomics England Data Model Catalogue (https://gelmc.extge.co.uk/#/40548/dataClass/40558 )\n\tUser Guide for Cancer Data Specification v3.0.0  (contained in this release pack)\n\tXML Schema Files (XSD) (contained in this release pack)\n\tExample CSV Files (contained in this release pack)\n\tNHS England GMC, Trust, Clinic, Laboratory Reference Data\n\tNHS England GMC Service Specification\n\tNational Cancer Intelligence Network Cancer Outcomes and Services Dataset (COSD) Version 7.0 User Guide \n\n\nHow to use this document\n\nThis document is split into sections that describe the information we expect to receive within the context of each xml submission, so it is primarily split by schema. Within each schema we expect to receive a set of classes of data. Within each class we expect to receive a number of data element, each of which is associated with a name, a brief explanation, a multiplicity, and a datatype.\nClick on the data types and business rules to navigate to the type.\nData types:\nContains the data types, rules and enumerations that constrain the value of a data element.\nRules are expressed as regular expressions and/or java code.\nEnumerations are described by their code and description:\npercent_necrosis\tProportion of the submitted tumour sample that is necrotic (0-100)\npicogreen_concentration\tPicogreen Concentration ng/ul\npicodrop_concentration\tPicoDrop Concentration ng/ul\n\nNOTE: Enumerations in grey are deprecated. Although deprecated codes will continue to be accepted they will re removed from the next release and users are encouraged to use other suitable codes.\n\nBusiness rules:\nContains the business rules that often apply across data elements within the context of a csv file submission i.e. if the test type is x we expect value y\n\nIn this version of the document, the data item identifiers have been included, to facilitate look-up in the current version of the on-line metadata catalogue. In addition you can click on the value link to view the full definition for the data type and the applicable constraints\n\n\nCompleteness:\n\nFrom a data modelling perspective most of the classes are optional, with the exception of the registration and consent information, in that an event of that class may not yet have occurred, or may not yet have been reported, for a particular participant.   \nEvent records or reports are required for all relevant clinical events or observations to date (for the core data).\nFor some classes of event, a report will be accepted only if additional classes are provided as part of the report and/or other values are supplied for some of the data items involved: these are the mandatory items within those classes.\nAn item is mandatory for a particular class if it has a multiplicity of 1..1 or 1..* \nWhere an item has a multiplicity of 0..1 it is considered non-mandatory and a report for that class of event will be accepted even if no value has been supplied for that item.   \nFrom a contractual perspective, however, values are expected for all applicable data",
